    "overview": "<p><b>Medellín</b> is the second largest city in <a title=\"Colombia\">Colombia</a>. It has over 3 million people and is the capital of the department of <a title=\"Antioquia\">Antioquia</a>. It's set in a valley running south to north just under one hour by plane from <a title=\"Bogotá\">Bogotá</a>.  In 2013 Medellin was awarded the <b>Innovative City of the Year</b> by The Wall Street Journal, outranking rivals New York and Tel Aviv . \n</p>",
