              "key": "WIKI_CUISINE",
              "value": "<html><body><div class=\"mw-parser-output\"><h3><span class=\"mw-headline\" id=\"Cuisine\">Cuisine</span></h3>\n\n\n<p>Colombia's varied cuisine is influenced by its diverse fauna and flora as well as the cultural traditions of the ethnic groups. Colombian dishes and ingredients vary widely by region. Some of the most common ingredients are: cereals such as rice and maize; tubers such as potato and <a title=\"Cassava\">cassava</a>; assorted <a title=\"Legume\">legumes</a>; meats, including beef, chicken, pork and goat; fish; and seafood. Colombia cuisine also features a variety of tropical <a title=\"Fruit\">fruits</a> such as <a title=\"Physalis peruviana\">cape gooseberry</a>, <a title=\"Acca sellowiana\">feijoa</a>, <a title=\"Eugenia stipitata\">arazá</a>, <a title=\"Pitaya\">dragon fruit</a>, <a class=\"mw-redirect\" title=\"Purple mangosteen\">mangostino</a>, <a title=\"Passiflora ligularis\">granadilla</a>, <a title=\"Papaya\">papaya</a>, <a title=\"Guava\">guava</a>, mora (<a title=\"Blackberry\">blackberry</a>), <a title=\"Solanum quitoense\">lulo</a>, <a class=\"mw-redirect\" title=\"Annona muricata\">soursop</a> and <a class=\"mw-redirect\" title=\"Passionfruit\">passionfruit</a>. Colombia is one of the world's largest consumers of fruit <a title=\"Juice\">juices</a>.\n</p><p>Among the most representative appetizers and soups are <a title=\"Tostones\">patacones</a> (fried green plantains), <a title=\"Sancocho\">sancocho</a> de gallina (chicken soup with root vegetables) and <a title=\"Ajiaco\">ajiaco</a> (potato and corn soup). Representative snacks and breads are <a title=\"Pandebono\">pandebono</a>, <a title=\"Arepa\">arepas</a> (corn cakes), <a title=\"Aborrajado\">aborrajados</a> (fried sweet plantains with cheese), <a title=\"Torta\">torta</a> de <a class=\"mw-redirect\" title=\"Choclo\">choclo</a>, <a title=\"Empanada\">empanadas</a> and <a title=\"Almojábana\">almojábanas</a>. Representative main courses are <a title=\"Bandeja paisa\">bandeja paisa</a>, <a class=\"mw-redirect\" title=\"Lechona tolimense\">lechona tolimense</a>, <a title=\"Ternera a la llanera\">mamona</a>, <a class=\"mw-redirect\" title=\"Tamales\">tamales</a> and fish dishes (such as <a title=\"Arroz de lisa\">arroz de lisa</a>), especially in coastal regions where <a title=\"Kibbeh\">kibbeh</a>, <a title=\"Suero\">suero</a>, <a title=\"Costeño cheese\">costeño cheese</a> and <a title=\"Carimañola\">carimañolas</a> are also eaten. Representative side dishes are papas chorreadas (potatoes with cheese), remolachas rellenas con huevo duro (beets stuffed with <a class=\"mw-redirect\" title=\"Hard-boiled egg\">hard-boiled egg</a>) and <a title=\"Coconut rice\">arroz con coco</a> (coconut rice). <a title=\"Organic food\">Organic food</a> is a current trend in big cities, although in general across the country the fruits and veggies are very natural and fresh.\n</p><p>Representative desserts are <a title=\"Buñuelo\">buñuelos</a>, <a class=\"mw-redirect\" title=\"Natilla\">natillas</a>, <a title=\"Maria Luisa cake\">Maria Luisa cake</a>, bocadillo made of guayaba (<a title=\"Guava jelly\">guava jelly</a>), <a class=\"mw-redirect\" title=\"Cocadas\">cocadas</a> (coconut balls), casquitos de guayaba (candied guava peels), <a title=\"Torta de nata\">torta de natas</a>, <a class=\"mw-redirect\" title=\"Oblea\">obleas</a>, <a title=\"Flan\">flan</a> de <a title=\"Mango\">mango</a>, <a title=\"Roscón\">roscón</a>, <a title=\"Milhoja\">milhoja</a>, <a title=\"Manjar blanco\">manjar blanco</a>, dulce de <a class=\"mw-redirect\" title=\"Feijoa\">feijoa</a>, dulce de <a title=\"Mountain papaya\">papayuela</a>, <a title=\"Torta\">torta</a> de mojicón, and esponjado de <a class=\"mw-redirect\" title=\"Curuba\">curuba</a>. Typical sauces (salsas) are <a title=\"Hogao\">hogao</a> (tomato and onion sauce) and Colombian-style <a title=\"Ají (sauce)\">ají</a>.\n</p><p>\nSome representative beverages are <a title=\"Coffee production in Colombia\">coffee</a> (Tinto), <a title=\"Champús\">champús</a>, <a title=\"Cholado\">cholado</a>, <a title=\"Lulada\">lulada</a>, <a class=\"mw-redirect\" title=\"Avena (beverage)\">avena</a> colombiana, <a title=\"Sugarcane\">sugarcane</a> juice, <a title=\"Aguapanela\">aguapanela</a>, <a title=\"Aguardiente\">aguardiente</a>, <a title=\"Hot chocolate\">hot chocolate</a> and fresh fruit juices (often made with water or milk).</p><div class=\"mw-references-wrap\"></div>\n<!-- \nNewPP limit report\nParsed by mw1233\nCached time: 20190704113901\nCache expiry: 2592000\nDynamic content: false\nComplications: [vary‐revision]\nCPU time usage: 0.156 seconds\nReal time usage: 0.185 seconds\nPreprocessor visited node count: 192/1000000\nPreprocessor generated node count: 0/1500000\nPost‐expand include size: 8094/2097152 bytes\nTemplate argument size: 0/2097152 bytes\nHighest expansion depth: 2/40\nExpensive parser function count: 0/500\nUnstrip recursion depth: 0/20\nUnstrip post‐expand size: 10660/5000000 bytes\nNumber of Wikibase entities loaded: 0/400\nLua time usage: 0.090/10.000 seconds\nLua memory usage: 2.26 MB/50 MB\n-->\n<!--\nTransclusion expansion time report (%,ms,calls,template)\n100.00%  157.542      1 -total\n 67.25%  105.953      5 Template:Cite_web\n 20.31%   31.992      1 Template:Main\n-->\n</div></body></html>",
