        "key": "COUNTRY_WIKI_LANGUAGES",
        "value": "<html><body><div class=\"mw-parser-output\"><h3><span class=\"mw-headline\" id=\"Languages\">Languages</span></h3>\n<p>The <a title=\"National language\">national language</a> of the country is <a title=\"Vietnamese language\">Vietnamese</a> (<i>Tiếng Việt</i>), a tonal <a title=\"Austroasiatic languages\">Austroasiatic language</a> (Mon–Khmer) which is spoken by the majority of the population. In its early history, Vietnamese writing used <a title=\"Chinese characters\">Chinese characters</a> before a different meaning set of Chinese characters known as <i><a class=\"mw-redirect\" title=\"Chữ nôm\">Chữ nôm</a></i> developed between the 7th–13th century. The folk epic <i lang=\"vi\" title=\"Vietnamese language text\"><a title=\"The Tale of Kieu\">Truyện Kiều</a></i> (\"The Tale of Kieu\", originally known as <i lang=\"vi\" title=\"Vietnamese language text\">Đoạn trường tân thanh</i>) by <a title=\"Nguyễn Du\">Nguyễn Du</a> was written in <i>Chữ nôm</i>. <i><a class=\"mw-redirect\" title=\"Quốc ngữ\">Quốc ngữ</a></i> as the romanised Vietnamese alphabet used for spoken Vietnamese, was developed in the 17th century by the <a class=\"mw-redirect\" title=\"Jesuit\">Jesuit</a> <a title=\"Alexandre de Rhodes\">Alexandre de Rhodes</a> and several other Catholic missionaries by using the alphabets of <a title=\"Romance languages\">Romance languages</a>, particularly the <a class=\"mw-redirect\" title=\"Portuguese alphabet\">Portuguese alphabet</a> which later became widely used through Vietnamese institutions during the French colonial period. Vietnam's minority groups speak a variety of languages, including <a title=\"Tày language\">Tày</a>, <a title=\"Muong language\">Mường</a>, <a title=\"Cham language\">Cham</a>, <a title=\"Khmer language\">Khmer</a>, <a title=\"Chinese language\">Chinese</a>, <a title=\"Nung language (Tai)\">Nùng</a> and <a title=\"Hmong language\">Hmong</a>. The <a class=\"mw-redirect\" title=\"Montagnard (Vietnam)\">Montagnard</a> peoples of the <a class=\"mw-redirect\" title=\"Central Highlands (Vietnam)\">Central Highlands</a> also speak a number of distinct languages as their language is derived from both the Austroasiatic and <a title=\"Malayo-Polynesian languages\">Malayo-Polynesian</a> language groups. In recent years, a number of <a title=\"Vietnamese sign languages\">sign languages</a> have developed in the major cities.\n</p>\n<p>\nThe <a title=\"French language\">French language</a>, a legacy of colonial rule, is spoken by many educated Vietnamese as a second language, especially among the older generation and those educated in the former <a title=\"South Vietnam\">South Vietnam</a>, where it was a principal language in administration, education, and commerce. Vietnam remains a full member of the <a title=\"Organisation internationale de la Francophonie\">International Organisation of the Francophonie</a> (La Francophonie) and education has revived some interest in the language. <a title=\"Russian language\">Russian</a> and to a much lesser extent <a title=\"German language\">German</a>, <a title=\"Czech language\">Czech</a> and <a title=\"Polish language\">Polish</a> are known among some northern Vietnamese whose families had ties with the Eastern Bloc during the Cold War. With improved relations with Western countries and recent reforms in Vietnamese administration, <a title=\"English language\">English</a> has been increasingly used as a second language and the study of English is now obligatory in most schools either alongside or in place of French. The popularity of <a title=\"Japanese language\">Japanese</a> and <a title=\"Korean language\">Korean</a> have also grown as the country's ties with other East Asian nations have strengthened.</p><div class=\"mw-references-wrap mw-references-columns\"></div>\n<!-- \nNewPP limit report\nParsed by mw1316\nCached time: 20190704114256\nCache expiry: 2592000\nDynamic content: false\nComplications: []\nCPU time usage: 0.220 seconds\nReal time usage: 0.263 seconds\nPreprocessor visited node count: 230/1000000\nPreprocessor generated node count: 0/1500000\nPost‐expand include size: 1424/2097152 bytes\nTemplate argument size: 0/2097152 bytes\nHighest expansion depth: 2/40\nExpensive parser function count: 0/500\nUnstrip recursion depth: 0/20\nUnstrip post‐expand size: 1944/5000000 bytes\nNumber of Wikibase entities loaded: 0/400\nLua time usage: 0.161/10.000 seconds\nLua memory usage: 9.62 MB/50 MB\n-->\n<!--\nTransclusion expansion time report (%,ms,calls,template)\n100.00%  230.506      1 -total\n 73.65%  169.758      2 Template:Lang\n 24.22%   55.827     13 Template:Sfn\n  1.63%    3.746      1 Template:Snf\n-->\n</div></body></html>",
